import EditerDxb from "./EditerDxb.vue";
import DelFrame from "@/components/DelFrame.vue";
export default {
  components: {
    EditerDxb: EditerDxb,
    DelFrame: DelFrame
  },
  data: function data() {
    return {
      addNewDataSidebar: false,
      sidebarData: {},
      set: [],
      total: 0,
      totalPages: 0,
      currentPage: 1,
      pageSize: 10,
      //删除------ + isDel方法
      delValide: false,
      delStatus: 0,
      del_id: '' //----------

    };
  },
  computed: {},
  watch: {
    "currentPage": {
      handler: function handler(val) {
        this.getList();
      }
    },
    "pageSize": {
      handler: function handler(val) {
        this.getList();
      }
    }
  },
  methods: {
    getList: function getList() {
      var _this = this;

      _this.$axios({
        url: "/admin/Setting/dxbList",
        method: "post",
        data: {
          page: _this.currentPage,
          pageSize: _this.pageSize
        }
      }).then(function (res) {
        if (res.data.status == 1) {
          _this.set = res.data.data.list;
          _this.total = res.data.data.total;
          _this.totalPages = _this.pageTotal(_this.total, _this.pageSize);
        } else {
          _this.set = [];
        }
      });
    },
    //"总条数"：rowCount，"每页总条数"：pageSize
    pageTotal: function pageTotal(rowCount, pageSize) {
      if (rowCount == null || rowCount == "") {
        return 0;
      } else {
        if (pageSize != 0 && rowCount % pageSize == 0) {
          return parseInt(rowCount / pageSize);
        }

        if (pageSize != 0 && rowCount % pageSize != 0) {
          return parseInt(rowCount / pageSize) + 1;
        }
      }
    },
    change: function change(tr) {
      var _this2 = this;

      var _this = this;

      _this.$axios({
        url: '/admin/Setting/editDxbStatus',
        method: "post",
        data: {
          id: tr.id,
          status: tr.status
        }
      }).then(function (res) {
        if (res.data.status == 1) {
          _this2.$vs.notify({
            title: '提示',
            text: res.data.msg,
            iconPack: 'feather',
            icon: 'icon-alert-circle',
            color: 'success'
          });
        } else {
          _this2.$vs.notify({
            title: '提示',
            text: res.data.msg,
            iconPack: 'feather',
            icon: 'icon-alert-circle',
            color: 'danger'
          });
        }

        _this.getList();
      });
    },
    toEdit: function toEdit(row) {
      // console.log(row);
      this.sidebarData = row;
      this.toggleDataSidebar(true);
    },
    //添加分组
    addNewData: function addNewData() {
      this.sidebarData = {};
      this.toggleDataSidebar(true);
    },
    toggleDataSidebar: function toggleDataSidebar() {
      var val = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : false;
      this.addNewDataSidebar = val;
    },
    //删除
    Delete: function Delete(id) {
      var _this = this;

      _this.del_id = id;

      _this.closeDel();
    },
    closeDel: function closeDel() {
      var _this = this;

      _this.delValide = true;
    },
    isDel: function isDel() {
      var val = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : false;

      if (val) {
        var _this = this;

        _this.$axios({
          url: "/admin/Setting/delSDxb",
          method: "post",
          data: {
            id: _this.del_id
          }
        }).then(function (res) {
          if (res.data.status == 1) {
            _this.getList();

            _this.delStatus = 1;
          } else {
            _this.delStatus = 2;
          }
        });
      }
    }
  },
  mounted: function mounted() {
    this.getList();
  }
};
